import React from 'react';
import {Route, Switch} from "react-router-dom"
import FbHeader from './FbHeader';
import FbLeftSlide from "./FbLeftSlide"
import FbRightSlide from "./FbRightSlide"
import Home from './Home';
import Marketplace from './Marketplace';
import Watch from './Watch';
import Group from './Group';
import Gaming from './Gaming';



const App = () => {
  return (
    <>
    {/* <h1>welcom</h1> */}
    <FbHeader/>
    <FbLeftSlide/>
    <FbRightSlide/>
      <Switch>
        <Route exact path="/" component={Home}>{Home}</Route>
        <Route exact path="/watch" component={Watch}></Route>
        <Route exact path="/marketplace" component={Marketplace}></Route>
        <Route exact path="/group" component={Group}></Route>
        <Route exact path="/gaming" component={Gaming}></Route>
      </Switch>
    </>
  )
}

export default App;
